import { Router } from "@angular/router";


export interface NavigationItem {
    id: string;
    title: string;
    icon?: string;
    url?: string;
    active?: boolean;
  }

  export class NavigationItems {

    navigationItens: NavigationItem
    {
        id: 'nav-cadastro',
        title: 'Cadastro',
        active: false,
        icon: 'feather icon-align-left',
        url: '/cadastro'
    },
    {
        id: 'nav-acoes',
        title: 'Ações',
        active: false,
        icon: 'feather icon-align-left',
        url: '/acoes'
    },
    {
        id: 'nav-controladora',
        title: 'Controladora',
        active: false,
        icon: 'feather icon-align-left',
        url: '/controladora'
    },
    {
        id: 'nav-visita',
        title: 'Visita',
        active: false,
        icon: 'feather icon-align-left',
        url: '/visita'
    },
    {
        id: 'nav-relatorios',
        title: 'Relatórios',
        active: false,
        icon: 'feather icon-align-left',
        url: '/relatorios'
    }

  }
